import React from "react";
import '../styles/Nav.css';

const Nav = function(){
    return(
        <nav>
        <p className="logo">Game<span>Space</span></p>
        <menu>
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/shop">Shop</a></li>
                <li><a href="/library">Library</a></li>
                <li><a href="/report">Report</a></li>
            </ul>
        </menu>
        <button>Login</button>
    </nav>
    );
}

export default Nav;
